import React from "react";
import "./HowToDO.css";
function HowToDo() {
  return (
    <div>
      <br></br>
      <h1 style={{ textAlign: "center", fontFamily: "inherit" }}>
        <b>How-To</b>
      </h1>
    </div>
  );
}

export default HowToDo;
